import React from "react";
import { Text, View } from 'react-native';

function Analytics() {
  return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
          <Text>Analytics screen here!!</Text>
          </View>
  );
}
export default Analytics;
